// src/components/NavBar.js
import '../styles/navbar.css';

function NavBar() {
  return (
    <nav className="navbar">

      <a href="#projects">Projects</a>
      <a href="#skills">Tech Stack</a>
      <a href="#contact">Contact</a>
    </nav>
  );
}

export default NavBar;
